import './App.css';


async function getExp(stlvl,endlvl,type){
  await fetch('/exp/'+stlvl+'/'+endlvl+'/'+type)
  .then(response => response.json())
  .then(data => console.log(data));
}

function App() {


  return (
    <div className="App">

      <input type="number" id="stlvl"></input>
      <input type="number" id="endlvl"></input>

      <select id = "type">
        <option value="NONE">NONE</option>
        <option value="MEGA">MEGA</option>
        <option value="TERA">TERA</option>
        <option value="HYPER">HYPER</option>
      </select>
      <button class="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded inline-flex items-center" onClick={() => getExp(document.getElementById("stlvl").value,document.getElementById("endlvl").value,document.getElementById("type").value)}> Get Exp </button>

      <button class="bg-gray-300 hover:bg-gray-400 text-gray-800 font-bold py-2 px-4 rounded inline-flex items-center">
        <svg class="fill-current w-4 h-4 mr-2" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20"><path d="M13 8V2H7v6H2l8 8 8-8h-5zM0 18h20v2H0v-2z"/></svg>
      <span>Download</span>
</button>    
    </div>
  );
}

export default App;
